"       </span>",
"       <span class=\"link\">",
"        urn:lims:b259:s2699683",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Talk with the doctor before starting any new drug, including prescription or OTC, natural products, or vitamins.",
"      </span>",
"     </li>",
"    </ul>",
