var content_f0_32_520=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F61773&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F61773&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Micrograph showing low turnover osteomalacia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 264px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Bone biopsy showing low turnover osteomalacia associated with aluminum accumulation in end-stage renal failure. Left panel: Goldner Masson trichrome stain shows thin mineralized bone in blue surrounded by wide unmineralized osteoid with no cellular activity in orange-brown. There are no osteoblasts or erosive surfaces present. Right panel: Villanueva stain following tetracycline labeling and viewed under fluorescent light reveals a marked increase in width of the osteoid seams (orange) with no evidence of mineralization of new bone (which would result in tetracycline deposition, as manifested by a yellow line appearing beneath the osteoid seams).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of L Darryl Quarles, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Micrograph showing normal bone histology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 382px; height: 269px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Histologic appearance of normal bone.",
"    <br>",
"     (Left panel) Goldner Masson trichrome stain shows mineralized lamellar bone in blue and adjacent nonmineralized osteoid in red-brown. Osteoid usually comprises less than 25 percent of bone surfaces. The cellular area between the osseous structures is the marrow space.",
"     <br>",
"      (Right panel) Villanueva-stained section viewed under polarized light following time-spaced tetracycline labeling. Osteoid appears orange, mineralized bone is green, and tetracycline markers appear as luminescent yellow-green bands within bone and beneath osteoid (arrow). The distinct dual bands represent active mineralized bone formation.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Courtesy of L Darryl Quarles, MD.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
