" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Sports associated with increased risk of ACL injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Football (ie, Soccer)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        American football",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Basketball",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Volleyball",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gymnastics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Team handball",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Downhill skiing",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
