var title_f0_32_524="Revised IPI";
var content_f0_32_524=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F64554&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F64554&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Revised International Prognostic Index (R-IPI) for diffuse large B-cell lymphoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Revised International Prognostic Index (R-IPI)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        Age &gt;60",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        Serum lactate dehydrogenase concentration above normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        ECOG performance status &ge;2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        Ann Arbor stage III or IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        Number of extranodal disease sites &gt;1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        One point is given for each of the above characteristics present in the patient, for a total score ranging from zero to five. When applied to patients with DLBCL who were treated with R-CHOP, 4 year overall survival (OS) and progression free survival (PFS) rates according to the score were as follows:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Score",
"       </td>",
"       <td class=\"subtitle2\">",
"        Risk group",
"       </td>",
"       <td class=\"subtitle2\">",
"        4-yr OS, percent",
"       </td>",
"       <td class=\"subtitle2\">",
"        4-yr PFS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Very good",
"       </td>",
"       <td>",
"        94",
"       </td>",
"       <td>",
"        94",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 or 2",
"       </td>",
"       <td>",
"        Good",
"       </td>",
"       <td>",
"        79",
"       </td>",
"       <td>",
"        80",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3 or more",
"       </td>",
"       <td>",
"        Poor",
"       </td>",
"       <td>",
"        55",
"       </td>",
"       <td>",
"        53",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Sehn LH, Berry B, Chhanabhai M, et al. The revised International Prognostic Index (R-IPI) is a better predictor of outcome than the standard IPI for patients with diffuse large B-cell lymphoma treated with R-CHOP. Blood 2007; 109:1857.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
