var title_f0_32_527="Reitan Test - part A";
var content_f0_32_527=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F83108&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F83108&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Reitan Test for hepatic encephalopathy (part A)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 372px; height: 708px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The Reitan Test (number connection test) is a commonly used bedside test that is useful for screening for hepatic encephalopathy.",
"    <br>",
"     <br>",
"      Step 1: Make sure that the patient is alert enough to cooperate for this test, can see adequately, has a writing surface, is able to count, and can hold a pen or pencil.",
"      <br>",
"       <br>",
"        Step 2: Demonstrate to the patient how to connect the numbers on the sample for part A (lower box).",
"        <br>",
"         &nbsp;",
"         <br>",
"          Step 3: Inform the patient that you will be timing&nbsp;the test&nbsp;and to complete the number connections from 1 to 25 as fast as&nbsp;the patient&nbsp;can without lifting the pen or pencil from the paper.",
"          <br>",
"           <br>",
"            Step 4: If an error occurs, point it out immediately and allow the patient to correct the error. The total elapsed time to&nbsp;complete the test, including the time spent corrrecting errrors, is the score.",
"            <br>",
"             <br>",
"              Step 5: Record the time spent to complete the test. If it takes longer than 3 minutes to complete test A, record \"&gt;3 minutes\" as the score.",
"              <br>",
"               <br>",
"                An alert person without hepatic encephalopathy should be able to complete&nbsp;part A of the test&nbsp;in seconds similar to their age in years.",
"                <div class=\"footnotes\">",
"                </div>",
"                <div class=\"reference\">",
"                </div>",
"               </br>",
"              </br>",
"             </br>",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
